export const Skeleton1 = () => (
	<>
		<div className="ant-skeleton">
			<div className="ant-skeleton-content">
				<h3 className="ant-skeleton-title" style="width: 38%;"></h3>
				<ul className="ant-skeleton-paragraph">
					<li></li>
					<li></li>
					<li style="width: 61%;"></li>
				</ul>
			</div>
		</div>
		<style jsx>{`
			.ant-skeleton {
				display: table;
				width: 100%;
			}
			.ant-skeleton-content {
				display: table-cell;
				width: 100%;
				vertical-align: top;
			}
			.ant-skeleton-content .ant-skeleton-title {
				width: 100%;
				height: 16px;
				margin-top: 16px;
				background: #f2f2f2;
				margin: 0;
				padding: 0;
			}
			.ant-skeleton-content
				.ant-skeleton-title
				+ .ant-skeleton-paragraph {
				margin-top: 24px;
			}
			.ant-skeleton-content .ant-skeleton-paragraph {
				padding: 0;
				list-style: none;
			}
			.ant-skeleton-content .ant-skeleton-paragraph > li {
				width: 100%;
				height: 16px;
				list-style: none;
				background: #f2f2f2;
				background: -webkit-gradient(
					linear,
					left top,
					right top,
					color-stop(25%, #f2f2f2),
					color-stop(37%, #e6e6e6),
					color-stop(63%, #f2f2f2)
				);
				background: linear-gradient(
					90deg,
					#f2f2f2 25%,
					#e6e6e6 37%,
					#f2f2f2 63%
				);
				background-size: 400% 100%;
				-webkit-animation: ant-skeleton-loading 1.4s ease infinite;
				animation: ant-skeleton-loading 1.4s ease infinite;
			}
		`}</style>
	</>
);
